import React, { useState } from "react";
import MapComponent from "./MapComponent";
import "./App.css";
import DailyLogSheet from "./DailyLogSheet";
import TripForm from "./TripForm";
import { Container, Row, Col } from "react-bootstrap";

function App() {
  const [logEntries, setLogEntries] = useState([]);
  const [tripDetails, setTripDetails] = useState(null);
  const [startLat, setStartLat] = useState(null);
  const [startLon, setStartLon] = useState(null);
  const [pickupLat, setPickupLat] = useState(null);
  const [pickupLon, setPickupLon] = useState(null);
  const [dropoffLat, setDropoffLat] = useState(null);
  const [dropoffLon, setDropoffLon] = useState(null);

  const handleFormSubmit = async (tripData) => {
    // Convert camelCase keys to snake_case
    const convertToSnakeCase = (obj) => {
      const newObj = {};
      for (const key in obj) {
        if (obj.hasOwnProperty(key)) {
          const snakeCaseKey = key.replace(/([A-Z])/g, "_$1").toLowerCase();
          newObj[snakeCaseKey] = obj[key];
        }
      }
      return newObj;
    };

    const apiUrl = "http://localhost:8000/api/trips/"; //Django server endpoint
    try {
      // First, check if trip exists
      const checkTripResponse = await fetch(`${apiUrl}check_existing/`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(convertToSnakeCase(tripData)),
      });

      if (!checkTripResponse.ok) {
        console.error(
          "Error checking existing trip:",
          checkTripResponse.status
        );
        return;
      }
      const checkTripData = await checkTripResponse.json();

      let tripId;
      if (checkTripData.exists) {
        tripId = checkTripData.trip.id;
        setTripDetails(checkTripData.trip);

        //SetLogs
        const logsDataResponse = await fetch(`${apiUrl}${tripId}/logs/`);
        if (!logsDataResponse.ok) {
          console.error("Error fetching logs:", logsDataResponse.status);
          return;
        }
        const logsData = await logsDataResponse.json();
        setLogEntries(logsData || []);
        // Call the state setter methods to assign these states (to make the map)
        setStartLat(34.0522);
        setStartLon(-118.2437);
        setPickupLat(41.8781);
        setPickupLon(-87.6298);
        setDropoffLat(40.7128);
        setDropoffLon(-74.006);
      } else {
        // First, create the trip in the backend
        const response = await fetch(`${apiUrl}`, {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify(tripData),
        });

        if (!response.ok) {
          console.error("Error creating trip:", response.status);
          return;
        }
        const newTrip = await response.json();
        tripId = newTrip.id;
        setTripDetails(newTrip);
        // Then, generate logs for the trip
        const logsResponse = await fetch(`${apiUrl}${tripId}/generate_logs/`, {
          method: "POST",
        });

        if (!logsResponse.ok) {
          console.error("Error generating logs:", logsResponse.status);
          return;
        }

        // Finally, fetch the generated logs
        const logsDataResponse = await fetch(`${apiUrl}${tripId}/logs/`);
        if (!logsDataResponse.ok) {
          console.error("Error fetching logs:", logsDataResponse.status);
          return;
        }

        const logsData = await logsDataResponse.json();
        setLogEntries(logsData);
        // Call the state setter methods to assign these states (to make the map)
        setStartLat(34.0522);
        setStartLon(-118.2437);
        setPickupLat(41.8781);
        setPickupLon(-87.6298);
        setDropoffLat(40.7128);
        setDropoffLon(-74.006);
      }
    } catch (error) {
      console.error("There was an issue", error);
    }
  };

  return (
    <Container>
      <h1>Trucker Logbook App</h1>
      <Row>
        <Col md={6}>
          <TripForm onSubmit={handleFormSubmit} />
        </Col>
        <Col md={6}>
          {tripDetails && (
            <MapComponent
              startLat={startLat}
              startLon={startLon}
              pickupLat={pickupLat}
              pickupLon={pickupLon}
              dropoffLat={dropoffLat}
              dropoffLon={dropoffLon}
            />
          )}
        </Col>
      </Row>
      <Row>
        <Col>
          {logEntries.length > 0 && <DailyLogSheet logEntries={logEntries} />}
        </Col>
      </Row>
    </Container>
  );
}

export default App;
